import React from 'react';
import './index.css'
const api={
    key:"3323833ffe9472f1851c4610d6f2fe0b",
    base:"https://api.openweathermap.org/data/2.5/"
}


function App() {
    return (
        <div className="app.warm">
              <main>
              <div className="search-box">
              <input 
              type="text"
              className="search-bar"
              placeholder="Search..."
              />
              </div>
              </main>
        </div>
    )
}



export default App;
